import React from 'react';

function Quickplay(props) {
    const { profile } = props;
    if (!profile.length) {
        return <h2>No Prof</h2>
    }
  return (
    <div>
      <h1>Quickplay Stats</h1>
    </div>
  );
}

export default Quickplay;
